 un grupo de adorables animales están preparando pasteles juntos. Aunque parecen cooperar en su deliciosa misión, lo que realmente hacen es maquinar unos contra otros para intentar poner sus ingredientes favoritos en todos los pasteles ¿Quién horneara el mayor número de pasteles mientras que \nconsigue colocar su ingrediente favorito en los pasteles de los demás para así convertirse en el mejor amienemigo de la fiesta?\n\n', 'families': ['Crowdfunding: Zeczec', 'Misc: LongPack Games'], 'is_expansion': False, 'expansions': [], 'expands': []};{'thumbnail': 'https://cf.geekdo-images.com/jm89wIruFI-Ekphk4hOzaA__thumb/img/Si8yuFyk4fUzNDALN6EmOr0Kr3s=/fit-in/200x150/filters:strip_icc()/pic5061793.jpg', 'image': 'https://cf.geekdo-images.com/jm89wIruFI-Ekphk4hOzaA__original/img/eN4Y8AFYABWpzJTWK0Hg64KIwjw=/0x0/filters:format(jpeg)/pic5061793.jpg'};30;""[{'username': 'attackofmilk', 'rating': '4', 'comment': '==2020/06/02== Oops, it turns out that ""try before buy"" can\'t be skipped, not even for cute games published by people I like.  I did some rulebook editing for the game, memorized the rules in the process, and knowing the rules didn\'t tell me that I didn\'t like the game.  It\'s basically ""Hidden Trackable Information: The Game.""  If you\'re taking notes, everyone\'s hand and score pile are *effectively* revealed, but nobody\'s going to be taking notes because it\'s a casual game.  There should be an interesting bluff/double-bluff mechanic where you\'re guessing, Did he take the blueberries because he\'s the blueberry animal, or because he\'s *not* the blueberry animal?  But you forget who has blueberries, so there\'s no Yomi play.  Also, ""choose who to ask for help"" is effectively the same as a ""choose who to attack"" mechanic.  If nobody asks you for help, you basically can\'t win.  I\'ve decided that, with my board gaming time, I want to play competitive games casually.  This is a casual game that frustrates players who have a competitive background.  If you\'re interested in a game of this size, weight, and playtime, Reiner Knizia\'s LAMA is still great.  Plays 2-6 (this game only plays 3-6), simple but deep, plays well at all player counts, and half the MSRP.  I wish GCFOX the best in publishing the game, but it\'s not for me, and I can\'t recommend it to people who approach gaming in a similar way to myself.  ==2020/05/23== I\'m hoping that the structured nature of play shapes the game away from Werewolf\'s tendency to publicly accuse and claim specific roles.  If I don\'t end up liking it, oh well.  I mostly bought it because I wanted to support GCFOX (and also Kana likes it).'}, {'username': 'BastardCafe', 'rating': 'n/a', 'comment': '1 14.2'}, {'username': 'BoardGameBanter', 'rating': '4.5', 'comment': 'Read our review here: https://boardgamegeek.com/thread/2564231/banter-impressions-frenemy-pastry-party'}, {'username': 'bomberah', 'rating': '7.5', 'comment': 'S-4 E-5'}, {'username': 'Brimat', 'rating': 'n/a', 'comment': 'Manufacturer Players: 3-6 Community Players: 3-6 Best Players: 3-6 Play Time: 15-30 Age: 8+ Weight: 1.00'}, {'username': 'Coltkun', 'rating': 'n/a', 'comment': 'KS'}, {'username': 'DogWhalefish', 'rating': '10', 'comment': 'Make cakes, not war. Unless, you can make cake war. Then make that.'}, {'username': 'd_ladd', 'rating': '7', 'comment': 'It is what is is. A cute little card game that is light and easy to play with family and kids. 7 rating for kids and families.'}, {'username': 'Geeken', 'rating': 'n/a', 'comment': '4KS 2024'}, {'username': 'Georgiagals', 'rating': 'n/a', 'comment': 'KS'}, {'username': 'Gyges', 'rating': '7.5', 'comment': ""Vaguely evocative of Knizia's Tower of Babel, which is high praise.""}, {'username': 'iadena', 'rating': 'n/a', 'comment': ""Don't buy.""}, {'username': 'IsaPoco', 'rating': '4', 'comment': '2019'}, {'username': 'KalicoK', 'rating': 'n/a', 'comment': '(3-6)'}, {'username': 'Marlowefire', 'rating': '5', 'comment': 'Tiff 5'}, {'username': 'moramis', 'rating': '2', 'comment': 'Semi-cooperative and encouraging of not. Bad.'}, {'username': 'Necroblaster3000', 'rating': '7', 'comment': ""You May Think He Loves You For Your Money But I Know What He Really Loves You For It's Your Brand New Leopard Skin Pillbox Hat""}, {'username': 'paxtt', 'rating': 'n/a', 'comment': 'Copies: All-PAX Library - 1, PAX Unplugged-only - 0.'}, {'username': 'pisecobabe', 'rating': '6', 'comment': ""SL20 Love the adorable animals - a good fit for November's food theme.""}, {'username': 'Poins', 'rating': 'n/a', 'comment': '+ neoprene mat'}, {'username': 'punkin312', 'rating': '5.5', 'comment': 'Super cute card game with adorable animals and yummy pastries. You are at the mercy of other players to rely on asking you to help make the cakes. Not sure the bonus cards are all even, but for a short card game it is fine.'}, {'username': 'qasic', 'rating': 'n/a', 'comment': 'punkin312 Jan 2021'}, {'username': 'Shampoo4you', 'rating': '6', 'comment': ""Pretty sure we got some rules wrong, but even so I don't think it's for me. If people refuse to trade with you, you lose your whole turn!""}, {'username': 'Silvurr', 'rating': 'n/a', 'comment': 'KS Version'}, {'username': 'The Cardboard Kid', 'rating': '5', 'comment': ""Original - 2019 12 25: If you have a group of mixed ages and/or languages, Frenemy Pastry Party could be a good choice if they don't mind nastiness. Honestly, I think this would be perfect for classrooms to play during recesses or free time. The art and simple-but-mean gameplay will probably appeal to a lot of kids, as long as they don't get frustrated easily.""}, {'username': 'themcguire', 'rating': '9', 'comment': 'excellent little simple and fun card game I want to play over and over'}, {'username': 'tina796242000', 'rating': '10', 'comment': '畫風超可愛療癒，運用於教育階段，能讓學生練習有禮貌詢問別人是否有什麼材料，可以一起做蛋糕，也要去計畫與思考如何利用角色牌任務，在助人材料的同時，也能自己烤蛋糕得分，還要記別人有拿什麼材料牌，才能和他借，就算沒有借成功材料，也可從中獲得訊息（a生可能沒有草莓和巧克力）'}, {'username': 'tool', 'rating': '5', 'comment': ""The hidden objectives don't seem great - the fox seems very easy to do unless someone else deliberately tries to deny you the points (which seems self-destructive), while the others are really under the control of the other players. Aside from those it's OK, but doesn't stand out at all.""}, {'username': 'ukyopoon', 'rating': '6.5', 'comment': '63.5 88.8 啤牌 64 x 89 (86張) 天'}, {'username': 'Whistle_pig', 'rating': '6', 'comment': 'Not convinced that the balance of reward between lending ingredients and baking cakes is quite right.  S'}]"');
